import { makeStyles } from "@material-ui/core/styles";

export default makeStyles((theme) => ({
	navBar: {
		backgroundColor: "#17202a",
		padding: "1rem 0",
	},
	logo: {
		position: "absolute",
		left: "10px",
	},
	navLinks: {
		color: "#f39c12",
	},
	toolBar: {
		display: "flex",
		justifyContent: "center",
		"@media (max-width: 780px)": {
			display: "none",
		},
	},
	responsive: {
		display: "none",
		"@media (max-width: 780px)": {
			display: "block",
			justifyContent: "space-around",
		},
	},
}));
